%[text] %[text:anchor:M_21A14582] \[3\] Schmid M, Lawrence GA, Parlange MB, Giometto MG (2019) Volume averaging for urban canopies. *Bound-Lay. Met.* **173**, 349-372.
%[text] %[text:anchor:M_5CCA5E02] \[4\] Suetzl BS, Rooney GG,  van Reeuwijk M (2020) Drag Distribution in Idealized Heterogeneous Urban Environments. *Bound-Lay. Met.* **178**,225-248.

